import React, {Component} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from 'react-bootstrap/Card';


const info = [
    {
        title: "Klubbmästare",
        name: "Oliver Jensen",
        img: null
    },
    {
        title: "Vice Klubbmästare",
        name: "Johan Widmark",
        img: null
    },
    {
        title: "Pubmästare",
        name: "Adam Henriksson",
        img: null
    },
    {
        title: "Marsall",
        name: "",
        img: null
    },
    {
        title: "Marsall",
        name: "",
        img: null
    }
];

function createCol(person, i){
    return (
        <Col sm key={"col_" + i}>
            <Card bg="dark">
                <Card.Header>{person.title}</Card.Header>
                <Card.Body>
                    <Card.Img src={logo}/>
                    <Card.Title>{person.name}</Card.Title>
                </Card.Body>
            </Card>
        </Col>
    )
}

function createRow(row, i){
    return(
        <Row key={"row_"+i}>
            { row }
        </Row>
    )
}


class KM extends Component {
    render(){
        const content = info.forEach((person, i) => createCol(person, i));
        return (
            <Container className="wide">
                <Row>
                    { content }
                </Row>
            </Container>
        )
    }

